import ExpenseItem from "./ExpenseItem";

function ExpenseArray(props) {
  return (
    <div>
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      />
    </div>
  );
}

export default ExpenseArray;
